	SnowUtils.parseTime=function(timeNum){
		if(!timeNum || timeNum <0)return "00:00:00";
		var hour=0,min=0,sec=0;
		timeNum=(timeNum / 1000)| 0;
		var timeStr="";
		hour=(timeNum / 3600)| 0;
		var tian=(hour / 24)| 0;
		hour=hour % 24;
		if (tian)
			timeStr+=tian+"天";
		if(hour<10){
			timeStr+="0"+hour;
			}else{
			timeStr+=hour;
		}
		timeStr+=":";
		min=((timeNum % 3600)/ 60)| 0;
		if(min <10){
			timeStr+="0"+min;
			}else{
			timeStr+=min;
		}
		timeStr+=":";
		sec=((timeNum % 360)% 60);
		if(sec <10){
			timeStr+="0"+sec;
			}else{
			timeStr+=sec;
		}
		return timeStr;
	}

